    getTime: function getTime() {
      var that = this;
      setInterval(function () {
        that.countDown();
      }, 1000);
    },
    //倒计时
    countDown: function countDown() {
      var dj = this.startTime;
      var that = this;
      that.remaining = that.djs(that.startTime);
      if (dj <= 0) {
        this.remaining = '已结束';
      } else {
        var ddf = this.djs(dj); //格式化过后的时间
        this.remaining = ddf;
        //当前时间减去时间
        dj = dj - 1;
        this.timeRange++;
        this.startTime = dj;
      }
    },
    //得到的秒换算成时分秒
    djs: function djs(ms) {
      var h = parseInt(ms / (60 * 60));
      var m = parseInt(ms % (60 * 60) / 60);
      var s = ms % (60 * 60) % 60;
      if (h < 10) {
        h = '0' + h;
      }
      if (m < 10) {
        m = '0' + m;
      }
      if (s < 10) {
        s = '0' + s;
      }
      return h + ':' + m + ':' + s;
    },
    getCurrentTime: function getCurrentTime() {
      var yy = new Date().getFullYear();
      var mm = new Date().getMonth() + 1;
      var dd = new Date().getDate();
      var hh = new Date().getHours();
      var mf = new Date().getMinutes() < 10 ? '0' + new Date().getMinutes() : new Date().getMinutes();
      var ss = new Date().getSeconds() < 10 ? '0' + new Date().getSeconds() : new Date().getSeconds();
      return yy + '-' + mm + '-' + dd + ' ' + hh + ':' + mf + ':' + ss;
    },
